import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getCardUtilityClass(slot) {
  return generateUtilityClass('JoyCard', slot);
}
const cardClasses = generateUtilityClasses('JoyCard', ['root', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantPlain', 'variantOutlined', 'variantSoft', 'variantSolid', 'sizeSm', 'sizeMd', 'sizeLg', 'row']);
export default cardClasses;
